prediction.sparql:
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?version ?publicationDate WHERE {
  wd:Q83 wdt:P348 ?version .
  OPTIONAL {
    wd:Q83 p:P348 ?versionStatement .
    ?versionStatement ps:P348 ?version ; pq:P577 ?publicationDate .
  }
}
ORDER BY ?publicationDate

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?goat ?goatLabel ?image ?startTime ?endTime WHERE {
  wd:Q151345 wdt:P161 ?goat .
  OPTIONAL {
    ?goat rdfs:label ?goatLabel FILTER ( LANG( ?goatLabel ) = "en" )
  }
  OPTIONAL {
    ?goat wdt:P18 ?image
  }
  OPTIONAL {
    ?goat wdt:P569 ?startTime
  }
  OPTIONAL {
    SELECT ?goat ( MIN( ?nextStartTime ) AS ?endTime ) WHERE {
      ?nextGoat wdt:P155 ?goat .
      ?nextGoat wdt:P569 ?nextStartTime .
      FILTER ( datatype( ?nextStartTime ) = xsd:dateTime || datatype( ?nextStartTime ) = xsd:date )
    }
    GROUP BY ?goat
  }
  BIND( COALESCE ( ?endTime , NOW () ) AS ?endTime )
}
ORDER BY ?startTime

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?person ?personLabel ?dateOfDeath ?archiveInstitution WHERE {
  ?person wdt:P21 wd:Q6581072 ; wdt:P570 ?dateOfDeath .
  FILTER ( ?dateOfDeath < "1948-01-01" ^^ xsd:date ) {
    ?person wdt:P19 ?birthPlace .
    VALUES ?birthPlace {
      wd:Q231554 wd:Q23482 wd:Q47465
    }
  } UNION {
    ?person wdt:P20 ?deathPlace .
    VALUES ?deathPlace {
      wd:Q231554 wd:Q23482 wd:Q47465
    }
  }
  OPTIONAL {
    ?person wdt:P485 ?archiveInstitution .
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
}
LIMIT 20

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?person ?personLabel ?netWorthAmount ?unit ?unitLabel WHERE {
  ?person wdt:P21 wd:Q6581072 ; wdt:P31 wd:Q5 ; p:P2218 ?netWorthStatement .
  ?netWorthStatement ps:P2218 ?netWorthValue .
  ?netWorthValue wikibase:quantityAmount ?netWorthAmount ; wikibase:quantityUnit ?unit .
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?unit rdfs:label ?unitLabel FILTER ( LANG( ?unitLabel ) = "en" )
  }
  FILTER ( ?netWorthAmount >= 1000000000 )
}
ORDER BY DESC ( ?netWorthAmount )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?numUnmarriedPartners ( COUNT( DISTINCT ?artist ) AS ?totalArtists ) ( COUNT( DISTINCT ?artistFemale ) AS ?numFemaleArtists ) ( COUNT( DISTINCT ?artistMale ) AS ?numMaleArtists ) WHERE {
  {
    SELECT ?artist ?gender ( COUNT( DISTINCT ?partner ) AS ?numUnmarriedPartners ) WHERE {
      ?artist wdt:P31 / wdt:P279 * wd:Q108289408 .
      ?artist wdt:P21 ?gender .
      OPTIONAL {
        ?artist wdt:P451 ?partner
      }
      FILTER ( ?gender IN ( wd:Q6581097 , wd:Q6581072 ) )
    }
    GROUP BY ?artist ?gender
  }
  OPTIONAL {
    ?artist wdt:P21 wd:Q6581072 .
    BIND( ?artist AS ?artistFemale )
  }
  OPTIONAL {
    ?artist wdt:P21 wd:Q6581097 .
    BIND( ?artist AS ?artistMale )
  }
}
GROUP BY ?numUnmarriedPartners
ORDER BY ?numUnmarriedPartners

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?mountain ?mountainLabel ?elevation WHERE {
  ?mountain wdt:P31 wd:Q8502 ; wdt:P2044 ?elevation ; wdt:P625 ?coordinate .
  FILTER ( ?elevation > 8000 ) FILTER NOT EXISTS {
    ?mountain wdt:P376 ?astronomicalBody .
    FILTER ( ?astronomicalBody != wd:Q2 )
  }
  OPTIONAL {
    ?mountain rdfs:label ?mountainLabel FILTER ( LANG( ?mountainLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?event ?eventLabel ?tournament ?tournamentLabel WHERE {
  ?event wdt:P31 wd:Q46190676 ; wdt:P641 wd:Q847 ; wdt:P2094 wd:Q16893072 ; wdt:P361 ?tournament .
  OPTIONAL {
    ?event wdt:P1346 ?winner .
  }
  FILTER ( ! BOUND( ?winner ) ) ?tournament wdt:P361 ?circuit .
  VALUES ?circuit {
    wd:Q300008 wd:Q3775082
  }
  ?event rdfs:label ?eventLabel FILTER ( LANG( ?eventLabel ) = "en" ) ?tournament rdfs:label ?tournamentLabel FILTER ( LANG( ?tournamentLabel ) = "en" )
}
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?institution ?institutionLabel ( COUNT( DISTINCT ?thesis ) AS ?thesisCount ) WHERE {
  ?thesis wdt:P4101 ?institution .
  ?thesis wdt:P31 / wdt:P279 * wd:Q1266946 .
  OPTIONAL {
    ?institution rdfs:label ?institutionLabel FILTER ( LANG( ?institutionLabel ) = "en" )
  }
}
GROUP BY ?institution ?institutionLabel
ORDER BY DESC ( ?thesisCount )
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?year ( COUNT( ?ensemble ) AS ?count ) WHERE {
  {
    SELECT ?ensemble ( YEAR( ?inception ) AS ?year ) WHERE {
      ?ensemble wdt:P31 wd:Q2088357 .
      ?ensemble wdt:P571 ?inception .
    }
  }
}
GROUP BY ?year
ORDER BY ?year

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?personLabel ?dateOfDeath ?familySearchID ?father ?fatherLabel WHERE {
  ?person wdt:P570 ?dateOfDeath ; wdt:P27 wd:Q16 ; wdt:P2889 ?familySearchID ; wdt:P22 ?father .
  FILTER NOT EXISTS {
    ?father wdt:P2889 ?fatherFamilySearchID .
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?father rdfs:label ?fatherLabel FILTER ( LANG( ?fatherLabel ) = "en" )
  }
}
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?work ?workLabel WHERE {
  ?work wdt:P50 wd:Q35610 ; wdt:P31 ?type .
  FILTER ( ?type IN ( wd:Q571 , wd:Q7725634 ) ) OPTIONAL {
    ?work rdfs:label ?workLabel FILTER ( LANG( ?workLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX geof: <http://www.opengis.net/def/function/geosparql/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?item ?itemLabel ( MIN( YEAR( ?creationDate ) ) AS ?creationYear ) ( GROUP_CONCAT( DISTINCT ?commemoratedEntityLabel ; separator = ", " ) AS ?commemoratedEntities ) ( GROUP_CONCAT( DISTINCT ?image ; separator = ", " ) AS ?images ) ( GROUP_CONCAT( DISTINCT STR( ?lat ) ; separator = ", " ) AS ?latitudes ) ( GROUP_CONCAT( DISTINCT STR( ?long ) ; separator = ", " ) AS ?longitudes ) WHERE {
  ?item wdt:P131 wd:Q1757 .
  ?item wdt:P1435 ?heritageDesignation .
  ?item rdfs:label ?itemLabel
  FILTER ( LANG( ?itemLabel ) = "en" ) .
  OPTIONAL {
    ?item wdt:P571 ?creationDate .
  }
  OPTIONAL {
    ?item wdt:P547 ?commemoratedEntity .
    ?commemoratedEntity rdfs:label ?commemoratedEntityLabel
    FILTER ( LANG( ?commemoratedEntityLabel ) = "en" )
  }
  OPTIONAL {
    ?item wdt:P18 ?image .
  }
  OPTIONAL {
    ?item wdt:P625 ?coordinates .
    BIND( geof:latitude ( ?coordinates ) AS ?lat ) BIND( geof:longitude ( ?coordinates ) AS ?long )
  }
}
GROUP BY ?item ?itemLabel
ORDER BY ?item
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?player ?playerLabel WHERE {
  ?player wdt:P106 wd:Q10833314 ; wdt:P27 wd:Q31 .
  FILTER NOT EXISTS {
    ?player wdt:P27 ?otherCitizenship .
    FILTER ( ?otherCitizenship != wd:Q31 )
  }
  OPTIONAL {
    ?player rdfs:label ?playerLabel FILTER ( LANG( ?playerLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?countryLabel ?startDate ?numberOfDeaths ?deathEvent ?deathEventLabel ?deathEventDate WHERE {
  wd:Q84104992 wdt:P17 ?country .
  OPTIONAL {
    wd:Q84104992 wdt:P580 ?startDate .
  }
  OPTIONAL {
    wd:Q84104992 wdt:P1120 ?numberOfDeaths .
  }
  OPTIONAL {
    ?deathEvent wdt:P361 wd:Q84104992 .
    ?deathEvent wdt:P1120 ?numberOfDeaths .
    OPTIONAL {
      ?deathEvent wdt:P580 ?deathEventDate .
    }
    OPTIONAL {
      ?deathEvent rdfs:label ?deathEventLabel FILTER ( LANG( ?deathEventLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
}
LIMIT 10

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?orgType ?orgTypeLabel ( COUNT( DISTINCT ?org ) AS ?count ) WHERE {
  ?org wdt:P31 ?orgType .
  ?org wdt:P131 wd:Q5765 .
  ?orgType wdt:P279 * wd:Q43229 .
  OPTIONAL {
    ?orgType rdfs:label ?orgTypeLabel FILTER ( LANG( ?orgTypeLabel ) = "en" )
  }
}
GROUP BY ?orgType ?orgTypeLabel
ORDER BY DESC ( ?count )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?item WHERE {
  ?item wdt:P279 + wd:Q87167 .
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?property ?propertyLabel ?value ?valueLabel WHERE {
  wd:Q9696 ?p ?value .
  ?property wikibase:directClaim ?p .
  OPTIONAL {
    ?property rdfs:label ?propertyLabel FILTER ( LANG( ?propertyLabel ) = "en" )
  }
  OPTIONAL {
    ?value rdfs:label ?valueLabel FILTER ( LANG( ?valueLabel ) = "en" )
  }
}
LIMIT 100

SELECT ?legalForm ?legalFormLabel ?count WHERE {
  {
    SELECT ?legalForm ?legalFormLabel (COUNT(?legalUnit) AS ?count) WHERE {
      ?legalUnit wdt:P31 ?legalForm ;
                 wdt:P17 wd:Q142 .
      ?legalForm wdt:P279 wd:Q10541491 .
      OPTIONAL { ?legalForm rdfs:label ?legalFormLabel FILTER(LANG(?legalFormLabel) = "fr") }
    }
    GROUP BY ?legalForm ?legalFormLabel
  }
  FILTER(?count > 499)
}
ORDER BY DESC(?count)

UNION

SELECT ("OTHER" AS ?legalFormLabel) (SUM(?count) AS ?count) WHERE {
  {
    SELECT ?legalForm (COUNT(?legalUnit) AS ?count) WHERE {
      ?legalUnit wdt:P31 ?legalForm ;
                 wdt:P17 wd:Q142 .
      ?legalForm wdt:P279 wd:Q10541491 .
    }
    GROUP BY ?legalForm
    FILTER(?count <= 499)
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX geof: <http://www.opengis.net/def/function/geosparql/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?settlement ?settlementLabel ?settlementCoordinate ?distanceKm ?meznoCoordinate WHERE {
  BIND( wd:Q2180733 AS ?mezno ) ?settlement wdt:P31 ?settlementType ; wdt:P17 wd:Q213 ; wdt:P625 ?settlementCoordinate .
  VALUES ?settlementType {
    wd:Q532 wd:Q3957
  }
  wd:Q2180733 wdt:P625 ?meznoCoordinate .
  BIND( geof:distance ( ?settlementCoordinate , ?meznoCoordinate ) AS ?distanceMeters ) BIND( ( ?distanceMeters / 1000 ) AS ?distanceKm ) FILTER ( ?distanceKm <= 35 ) OPTIONAL {
    ?settlement rdfs:label ?settlementLabel FILTER ( LANG( ?settlementLabel ) = "en" )
  }
}
ORDER BY ?distanceKm
LIMIT 10

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?periodical ?periodicalLabel WHERE {
  ?periodical wdt:P31 wd:Q1002697 ; wdt:P407 wd:Q143 .
  OPTIONAL {
    ?periodical rdfs:label ?periodicalLabel FILTER ( LANG( ?periodicalLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?city ?cityLabel ?population ?coordinate WHERE {
  ?city wdt:P31 wd:Q515 ; wdt:P17 wd:Q159 ; wdt:P1082 ?population ; wdt:P625 ?coordinate .
  FILTER ( ?population > 100000 ) OPTIONAL {
    ?city rdfs:label ?cityLabel FILTER ( LANG( ?cityLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?chapter ?chapterLabel ?japaneseTitle ?volume ?volumeLabel ?seriesOrdinal ?publicationDate ?placeOfPublication ?placeOfPublicationLabel WHERE {
  ?chapter wdt:P31 wd:Q53460949 ; wdt:P179 wd:Q3853685 .
  OPTIONAL {
    ?chapter rdfs:label ?japaneseTitle FILTER ( LANG( ?japaneseTitle ) = "ja" )
  }
  OPTIONAL {
    ?chapter rdfs:label ?chapterLabel FILTER ( LANG( ?chapterLabel ) = "en" )
  }
  OPTIONAL {
    ?chapter wdt:P478 ?volume .
    OPTIONAL {
      ?volume rdfs:label ?volumeLabel FILTER ( LANG( ?volumeLabel ) )
    }
  }
  OPTIONAL {
    ?chapter wdt:P1545 ?seriesOrdinal .
  }
  OPTIONAL {
    ?chapter wdt:P577 ?publicationDate .
  }
  OPTIONAL {
    ?chapter wdt:P291 ?placeOfPublication .
    OPTIONAL {
      ?placeOfPublication rdfs:label ?placeOfPublicationLabel FILTER ( LANG( ?placeOfPublicationLabel ) )
    }
  }
}
ORDER BY ?seriesOrdinal ?publicationDate ?chapter
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?countryLabel ?capital ?capitalLabel ?currency ?currencyLabel WHERE {
  ?country wdt:P31 wd:Q3624078 .
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q3024240
  }
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q918
  }
  OPTIONAL {
    ?country wdt:P36 ?capital .
  }
  OPTIONAL {
    ?country wdt:P38 ?currency .
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel .
    FILTER ( LANG( ?countryLabel ) = "en" )
  }
  OPTIONAL {
    ?capital rdfs:label ?capitalLabel .
    FILTER ( LANG( ?capitalLabel ) = "en" )
  }
  OPTIONAL {
    ?currency rdfs:label ?currencyLabel .
    FILTER ( LANG( ?currencyLabel ) = "en" )
  }
}
LIMIT 10

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?countryLabel ?flagImage ?population WHERE {
  ?country wdt:P31 wd:Q6256 .
  ?country wdt:P1082 ?population .
  OPTIONAL {
    ?country wdt:P41 ?flagImage .
  }
  ?country rdfs:label ?countryLabel .
  FILTER ( LANG( ?countryLabel ) = "en" )
}
ORDER BY DESC ( ?population )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?personLabel ?birthplace ?birthplaceLabel ?dob WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P106 wd:Q36180 ; wdt:P27 wd:Q30 ; wdt:P19 ?birthplace ; wdt:P569 ?dob .
  FILTER NOT EXISTS {
    ?person wdt:P570 ?dod
  }
  FILTER ( ?dob > "1919-12-31" ^^ xsd:date ) FILTER ( ?birthplace = wd:Q771 || EXISTS {
    ?birthplace wdt:P131 * wd:Q771
  }
  ) OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?birthplace rdfs:label ?birthplaceLabel FILTER ( LANG( ?birthplaceLabel ) = "en" )
  }
}
ORDER BY ?dob
LIMIT 200

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?article WHERE {
  ?article wdt:P1433 wd:Q15817086 .
  FILTER ( NOT EXISTS {
    ?article rdfs:label ?label FILTER ( LANG( ?label ) = "en" )
  }
  )
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?unit ?unitLabel ?part ?partLabel ?largerUnit ?largerUnitLabel ?geolexID WHERE {
  VALUES ?class {
    wd:Q3550897 wd:Q736917 wd:Q824979 wd:Q2092603 wd:Q11755853 wd:Q11755860 wd:Q108572982 wd:Q806617 wd:Q7452453 wd:Q101604684
  }
  ?unit wdt:P31 ?class .
  OPTIONAL {
    ?unit rdfs:label ?unitLabel FILTER ( LANG( ?unitLabel ) = "en" )
  }
  OPTIONAL {
    ?unit wdt:P1630 ?geolexID
  }
  OPTIONAL {
    ?unit wdt:P527 ?part .
    OPTIONAL {
      ?part rdfs:label ?partLabel FILTER ( LANG( ?partLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?unit wdt:P361 ?largerUnit .
    OPTIONAL {
      ?largerUnit rdfs:label ?largerUnitLabel FILTER ( LANG( ?largerUnitLabel ) = "en" )
    }
  }
  FILTER ( EXISTS {
    ?unit wdt:P276 | wdt:P131 | wdt:P301 wd:Q816
  }
  || EXISTS {
    ?unit wdt:P527 ?part .
    ?part wdt:P276 | wdt:P131 | wdt:P301 wd:Q816
  }
  || EXISTS {
    ?unit wdt:P361 ?largerUnit .
    ?largerUnit wdt:P276 | wdt:P131 | wdt:P301 wd:Q816
  }
  )
}
ORDER BY ?unitLabel
LIMIT 100

