PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?ruralCommune ?ruralCommuneLabel WHERE {
  ?ruralCommune wdt:P31 wd:Q17318027 .
  ?ruralCommune wdt:P17 wd:Q1028 .
  OPTIONAL {
    ?ruralCommune rdfs:label ?ruralCommuneLabel FILTER ( LANG( ?ruralCommuneLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?urbanMunicipality ?urbanMunicipalityLabel ?officialWebsite ?coordinate ?federatedState ?federatedStateLabel WHERE {
  ?federatedState wdt:P31 wd:Q1221156 .
  ?federatedState wdt:P17 wd:Q183 .
  ?urbanMunicipality wdt:P31 wd:Q42744322 .
  ?urbanMunicipality wdt:P17 wd:Q183 .
  ?urbanMunicipality wdt:P131 + ?federatedState .
  OPTIONAL {
    ?urbanMunicipality wdt:P856 ?officialWebsite .
  }
  OPTIONAL {
    ?urbanMunicipality wdt:P625 ?coordinate .
  }
  OPTIONAL {
    ?urbanMunicipality rdfs:label ?urbanMunicipalityLabelEN .
    FILTER ( LANG( ?urbanMunicipalityLabelEN ) = "en" )
  }
  OPTIONAL {
    ?urbanMunicipality rdfs:label ?urbanMunicipalityLabelDE .
    FILTER ( LANG( ?urbanMunicipalityLabelDE ) = "de" )
  }
  BIND( COALESCE ( ?urbanMunicipalityLabelEN , ?urbanMunicipalityLabelDE ) AS ?urbanMunicipalityLabel ) OPTIONAL {
    ?federatedState rdfs:label ?federatedStateLabelEN .
    FILTER ( LANG( ?federatedStateLabelEN ) = "en" )
  }
  OPTIONAL {
    ?federatedState rdfs:label ?federatedStateLabelDE .
