SELECT ?municipality ?municipalityLabelEN ?municipalityLabelES ?municipalityLabelEU ?recentPopulation ?recentYear ?pastPopulation ?pastYear WHERE {
  ?municipality wdt:P31 / wdt:P279 * wd:Q15284 ; wdt:P131 / wdt:P131 * wd:Q93366 ; p:P1082 ?populationStatement .
