          ?municipality wdt:P131 / wdt:P131 * wd:Q93366 ; p:P1082 ?ps10 .
          ?ps10 pq:P585 ?year10 .
          FILTER ( YEAR( ?year10 ) <= ( ?maxYear - 9 ) )
