# Query 1: List of municipalities in Austria with German labels, latitudes, longitudes, and populations
SELECT ?municipality ?municipalityLabel (xsd:decimal(REPLACE(STR(?coord), "^POINT\\(([-+]?[0-9]*\\.?[0-9]+) ([-+]?[0-9]*\\.?[0-9]+)\\)$", "$2")) AS ?latitude) (xsd:decimal(REPLACE(STR(?coord), "^POINT\\(([-+]?[0-9]*\\.?[0-9]+) ([-+]?[0-9]*\\.?[0-9]+)\\)$", "$1")) AS ?longitude) ?population WHERE {
  ?municipality wdt:P31 wd:Q667509.  # instance of municipality of Austria
  OPTIONAL { ?municipality wdt:P576 ?dissolved. }
  FILTER(!BOUND(?dissolved))  # municipality still in existence
  OPTIONAL { ?municipality wdt:P625 ?coord. }
  OPTIONAL { ?municipality wdt:P1082 ?population. }
  OPTIONAL { ?municipality rdfs:label ?municipalityLabel FILTER(LANG(?municipalityLabel) = "de") }
} ORDER BY ?municipalityLabel

# Query 2: Averages of latitude, longitude, and population of municipalities in Austria
SELECT (AVG(xsd:decimal(REPLACE(STR(?coord), "^POINT\\(([-+]?[0-9]*\\.?[0-9]+) ([-+]?[0-9]*\\.?[0-9]+)\\)$", "$2"))) AS ?avgLat) (AVG(xsd:decimal(REPLACE(STR(?coord), "^POINT\\(([-+]?[0-9]*\\.?[0-9]+) ([-+]?[0-9]*\\.?[0-9]+)\\)$", "$1"))) AS ?avgLong) (AVG(?population) AS ?avgPopulation) WHERE {
  ?municipality wdt:P31 wd:Q667509.  # instance of municipality of Austria
  OPTIONAL { ?municipality wdt:P576 ?dissolved. }
  FILTER(!BOUND(?dissolved))  # municipality still in existence
  ?municipality wdt:P625 ?coord.
  OPTIONAL { ?municipality wdt:P1082 ?population. }
}

