  ?country wdt:P463 wd:Q1065 ; wdt:P31 wd:Q6256 .
  OPTIONAL {
    ?country wdt:P36 ?capital .
    OPTIONAL {
      ?capital rdfs:label ?capitalLabel FILTER ( LANG( ?capitalLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?country wdt:P1082 ?population .
  }
  OPTIONAL {
    ?country wdt:P2046 ?area .
  }
  OPTIONAL {
    ?country wdt:P35 ?headOfState .
    OPTIONAL {
      ?headOfState rdfs:label ?headOfStateLabel FILTER ( LANG( ?headOfStateLabel ) = "en" )
    }
    OPTIONAL {
      ?headOfState wdt:P18 ?headOfStateImage .
    }
  }
  OPTIONAL {
    ?country wdt:P38 ?currency .
    OPTIONAL {
      ?currency rdfs:label ?currencyLabel FILTER ( LANG( ?currencyLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?country wdt:P41 ?flagImage .
  }
  OPTIONAL {
    ?country wdt:P625 ?coordinateLocation .
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
}
