PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT ?award ?awardLabel ( COUNT( DISTINCT ?person ) AS ?totalCount ) ( COUNT( DISTINCT ?personBefore ) AS ?beforeCount ) ( COUNT( DISTINCT ?personAfter ) AS ?afterCount ) ( COUNT( DISTINCT ?personSame ) AS ?sameTimeCount ) ( COUNT( DISTINCT ?personUnknown ) AS ?unknownTimeCount ) WHERE {
  BIND( wd:Q703205 AS ?leibnizPrize ) ?person wdt:P31 wd:Q5 ; wdt:P166 ?leibnizPrize ; wdt:P166 ?award .
  VALUES ?awardType {
    wd:Q15383322 wd:Q11448906 wd:Q378427 wd:Q107471279 wd:Q107494520 wd:Q1966910 wd:Q1709894
  }
  ?award wdt:P31 ?awardType .
  OPTIONAL {
    ?person p:P166 ?leibnizStatement .
    ?leibnizStatement ps:P166 ?leibnizPrize .
    OPTIONAL {
      ?leibnizStatement pq:P585 ?leibnizDate .
    }
  }
  OPTIONAL {
    ?person p:P166 ?awardStatement .
    ?awardStatement ps:P166 ?award .
    OPTIONAL {
      ?awardStatement pq:P585 ?awardDate .
    }
  }
  BIND( IF( ! BOUND( ?awardDate ) || ! BOUND( ?leibnizDate ) , "unknown" , IF( ?awardDate < ?leibnizDate , "before" , IF( ?awardDate > ?leibnizDate , "after" , IF( ?awardDate = ?leibnizDate , "same" , "unknown" ) ) ) ) AS ?timing ) OPTIONAL {
    ?award rdfs:label ?awardLabel FILTER ( LANG( ?awardLabel ) = "en" )
  }
  BIND( IF( ?timing = "before" , ?person , "" ) AS ?personBefore ) BIND( IF( ?timing = "after" , ?person , "" ) AS ?personAfter ) BIND( IF( ?timing = "same" , ?person , "" ) AS ?personSame ) BIND( IF( ?timing = "unknown" , ?person , "" ) AS ?personUnknown ) FILTER ( ?timing IN ( "before" , "after" , "same" , "unknown" ) )
}
GROUP BY ?award ?awardLabel
ORDER BY DESC ( ?totalCount )
LIMIT 100

