SELECT DISTINCT ?municipality ?municipalityLabel ?idescatCode ?population ?area ?coatOfArms WHERE {
  ?municipality wdt:P4335 ?idescatCode .
  FILTER ( STRSTARTS( ?idescatCode , "25" ) ) ?municipality wdt:P131 * wd:Q5705 .
  OPTIONAL {
    SELECT ?municipality ( SAMPLE( ?pop ) AS ?population ) WHERE {
      ?municipality p:P1082 ?popStatement .
      ?popStatement ps:P1082 ?pop .
    }
    GROUP BY ?municipality
  }
  OPTIONAL {
    ?municipality wdt:P2046 ?area .
  }
  OPTIONAL {
    ?municipality wdt:P94 ?coatOfArms .
  }
  OPTIONAL {
    ?municipality rdfs:label ?municipalityLabel .
    FILTER ( LANG( ?municipalityLabel ) IN ( "en" , "ca" , "es" ) )
  }
}
ORDER BY ?municipalityLabel ?municipality
LIMIT 50

